import React from 'react';

export default function  Title( props) {
    const titleName = props.titleName; 
    const index = props.index; 
    const size = null ; 

    const styles = {
        h3: {
            fontSize: size, 
        }
    }

    return (
        <h3 style={styles}> {index} <span> {titleName}</span> </h3>
    )
}
